import React from 'react';
import './App.css';


import {Header} from './component/Header/index';

type State = typeof initState;
const initState = {
  string: "Hello my friend" as string
}
class App extends React.Component<{},State>{
  state= initState;

  render(){
    return(
      <div className="App">
        <h1>{this.state.string}</h1>
        <Header/>
      </div>
    );
  }
}

export default App;
